INSERT INTO `cds` VALUES (1,'Young - Baffin Bay - 2013',3,'Be-10','Baffin Bay calibration data set of Young and others (2013). Several sites in West Greenland and eastern Baffin Island. '),(2,'Stroeven - Scandinavia - 2015',20,'Be-10','Sites in Norway and Sweden compiled by Stroeven et al. (2015). \"Version B\" in their paper; includes pruning of outliers from all sites. '),(3,'Balco - NENA - 2009',1,'Be-10','Northeast North America calibration data set of Balco and others (2009). Outliers identified in paper removed. '),(4,'CRONUS - Primary Be-10 - 2015',2,'Be-10','CRONUS-Earth \"Primary\" Be-10 calibration data set of Borchers et al. (2015). '),(5,'CRONUS - Primary Al-26 - 2015',2,'Al-26','CRONUS-Earth \"Primary\" Al-26 calibration data set of Borchers et al. (2015). '),(6,'CRONUS - Secondary Be-10 - 2015',2,'Be-10','CRONUS-Earth \"Secondary\" Be-10 calibration data set of Borchers et al. (2015). '),(7,'CRONUS - Secondary Al-26 - 2015',2,'Al-26','CRONUS-Earth \"Secondary\" Al-26 calibration data set of Borchers et al. (2015). '),(8,'CRONUS - Primary He-3 - 2015',2,'He-3','CRONUS-Earth \"Primary\" He-3 calibration data set of Borchers et al. (2015). '),(9,'CRONUS - Secondary He-3 - 2015',2,'He-3','CRONUS-Earth \"Secondary\" He-3 calibration data set of Borchers et al. (2015). ');
