5 5 3 4 6 0 2',NULL,NULL),(9,'07-NE-001-BH',44.3143,-71.574,417,0.9999,3.6,'Coarse-grained pink granite','BEECH',2.63,'Boulder on top of moraine crest -- several meters from edge of ridgetop. Sitting directly on other boulders. Lichen common on top surface, little moss present. Surface is rough at 0.5-cm scale. Some linear etching features, several cm wide, ca. 1 cm deep. Estimated sample thickness 3 cm.','Erratic boulder','Greg Balco, John Gosse, Woody Thompson, Brent Goehring, Amanda Henck, Joe Licciardi, Sara Mitchell, Thom Davis, Roger Hooke, Amy Gaffney','2007-11-17','50 80 90 115 145 170 210 260 320','0 0 5 5 3 4 6 0 2',NULL,NULL),(10,'07-NE-002-BH',44.3139,-71.575,412,0.9999,4.6,'Coarse-grained pink granite','BEECH',2.63,'Top of moraine crest, well away from any break in slope. 2-4 cm moss covers most of boulder surface. Small-scale surface roughness has 0.5-cm relief. Gentle 20-30-cm-wide swales in surface have 1-2 cm relief.','Erratic boulder','Greg Balco, John Gosse, Woody Thompson, Brent Goehring, Amanda Henck, Joe Licciardi, Sara Mitchell, Thom Davis, Roger Hooke, Amy Gaffney','2007-11-17','50 80 90 115 145 170 210 260 320','0 0 5 5 3 4 6 0 2',NULL,NULL),(11,'07-NE-003-BH',44.311,-71.5766,411,0.9999,2.2,'Coarse-grained pink granite','BEECH',2.63,'Quartz vein exposed on top and side of boulder. Max relief of quartz vein is 1.5 cm by calipers. Most of vein has 0.7 cm relief. Moraine crest well away from breaks in slope.','Erratic boulder','Greg Balco, John Gosse, Woody Thompson, Brent Goehring, Amanda Henck, Joe Licciardi, Sara Mitchell, Thom Davis, Roger Hooke, Amy Gaffney','2007-11-17','50 80 90 115 145 170 210 260 320','0 0 5 5 3 4 6 0 2',NULL,NULL),(12,'07-NE-004-BH',44.3114,-71.575,412,0.9999,3.9,'Coarse-grained pink granite','BEECH',2.63,'Small-scale surface roughness has ca. 0.5-cm relief. Sample collected from area of 3-5 cm positive relief, ca. 50 cm wide. Estimated sample thickness is 5 cm. In flat terrain on gently (few degrees) sloping moraine 